{
  "ubx_message": {
    "name": "UBX-SEC-SIGLOG",
    "class_id": "0x27",
    "message_id": "0x10",
    "message_type": "periodic_polled",
    "payload_length": {
      "variable": {
        "base": 8,
        "formula": "8 + numEvents * 8"
      }
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U1",
        "name": "version",
        "description": "Message version (0x00 for this version)",
        "fixed_value": 0
      },
      {
        "byte_offset": 1,
        "data_type": "U1",
        "name": "numEvents",
        "description": "Number of events"
      },
      {
        "byte_offset": 2,
        "data_type": {
          "array_of": "U1",
          "count": 6
        },
        "name": "reserved0",
        "description": "Reserved",
        "reserved": true
      },
      {
        "byte_offset": 8,
        "data_type": "U4",
        "name": "timeElapsed",
        "unit": "s",
        "description": "Seconds elapsed since this event",
        "repeated_group": "numEvents"
      },
      {
        "byte_offset": 12,
        "data_type": "U1",
        "name": "detectionType",
        "description": "Type of the spoofing or jamming detection:\n0 = simulated signal\n1 = abnormal signal\n2 = INS/GNSS mismatch\n3 = abrupt changes in GNSS signal\n4 = broadband jamming/interference\n5 = narrowband jamming/interference",
        "repeated_group": "numEvents"
      },
      {
        "byte_offset": 13,
        "data_type": "U1",
        "name": "eventType",
        "description": "Type of the event:\n0 = indication started\n1 = indication stopped\n2 = indication triggered\n3 = indication timed-out",
        "repeated_group": "numEvents"
      },
      {
        "byte_offset": 14,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "name": "reserved1",
        "description": "Reserved",
        "reserved": true,
        "repeated_group": "numEvents"
      }
    ]
  }
}
